<!DOCTYPE html>
<html lang="es">
<head>
  <meta charset="utf-8"/>
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Visor MaxEnt - San Bernardo del Viento – Chinú</title>
  <link rel="stylesheet" href="https://unpkg.com/leaflet@1.9.4/dist/leaflet.css"/>
  <script src="https://unpkg.com/leaflet@1.9.4/dist/leaflet.js"></script>
  <script src="https://unpkg.com/geotiff@2.1.3/dist-browser/geotiff.js"></script>
  <script src="https://unpkg.com/georaster/dist/georaster.min.js"></script>
  <script src="https://unpkg.com/georaster-layer-for-leaflet/dist/georaster-layer-for-leaflet.min.js"></script>
  <style>
    html, body, #map {
      height: 100%;
      margin: 0;
      padding: 0;
    }
    /* Contenedor lateral derecho para todos los elementos */
    .side-panel {
      position: absolute;
      bottom: 10px;
      right: 10px;
      display: flex;
      flex-direction: column;
      align-items: flex-end;
      gap: 8px;
      z-index: 9999;
      pointer-events: none;
    }
    .legend, .info-box, .logo-invias {
      background: rgba(255,255,255,0.95);
      border-radius: 6px;
      box-shadow: 0 0 6px rgba(0,0,0,0.4);
      pointer-events: auto;
    }
    .legend {
      padding: 8px;
      font-size: 11px;
      line-height: 13px;
      text-align: left;
    }
    .legend div {
      display: flex;
      align-items: center;
      margin-bottom: 2px;
    }
    .legend span {
      display: inline-block;
      width: 18px;
      height: 10px;
      margin-right: 5px;
      border: 1px solid #333;
    }
    .info-box {
      padding: 8px;
      font-size: 12px;
      max-width: 220px;
    }
    .logo-invias img {
      height: 60px;
      border-radius: 6px;
      padding: 4px;
    }
  </style>
</head>

  function base64ToArrayBuffer(base64) {
    const binary = atob(base64);
    const len = binary.length;
    const bytes = new Uint8Array(len);
    for (let i = 0; i < len; i++) bytes[i] = binary.charCodeAt(i);
    return bytes.buffer;
  }

  document.addEventListener("DOMContentLoaded", async () => {
    const baseOSM  = L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', { maxZoom: 19 });
    const baseESRI = L.tileLayer('https://server.arcgisonline.com/ArcGIS/rest/services/World_Imagery/MapServer/tile/{z}/{y}/{x}', { maxZoom: 19 }).addTo(map);
    const baseTopo = L.tileLayer('https://server.arcgisonline.com/ArcGIS/rest/services/World_Topo_Map/MapServer/tile/{z}/{y}/{x}', { maxZoom: 19 });
    
    const map = L.map('map');
    map.fitBounds([[9.110727107753002, -75.95440813011517], [9.349488568186517, -75.4000888458146]]);


    const rasterData = base64ToArrayBuffer(geotiffB64);
    const georaster = await parseGeoraster(rasterData);
    const colors = ["#00441b", "#1b7837", "#5aae61", "#a6dba0", "#d9f0d3", "#fee08b", "#fdae61", "#f46d43", "#d73027", "#a50026"];
    const colorFn = v => (v == null || isNaN(v) || v < 0 || v > 1) ? null : colors[Math.min(9, Math.floor(v * 10))];
    const rasterLayer = new GeoRasterLayer({
      georaster,
      pixelValuesToColorFn: vals => colorFn(vals[0]),
      opacity: 0.8,
      resolution: 256
    }).addTo(map);

    const viasLayer = L.geoJSON(geojsonVias, {
      style: { color: '#111', weight: 3.2, opacity: 0.9 },
      onEachFeature: (f, l) => {
        let html = '<table style="font-size:12px">';
        for (let k in f.properties) html += `<tr><td><b>${k}</b></td><td>${f.properties[k]}</td></tr>`;
        html += '</table>';
        l.bindPopup(html);
      }
    }).addTo(map);

    const prLayer = L.geoJSON(geojsonPR, {
      pointToLayer: (f, latlng) => L.circleMarker(latlng, {
        radius: 5, fillColor: '#1E90FF', color: '#003366', weight: 1, fillOpacity: 0.9
      }),
      onEachFeature: (f, l) => {
        const props = f.properties || {};
        const key = Object.keys(props).find(k => k.toLowerCase() === 'posterefer');
        const label = key ? String(props[key]) : '(sin posterefer)';
        l.bindTooltip(label, { permanent: true, direction: 'top', offset: [0, -6] });
      }
    }).addTo(map);

    L.control.layers(
      {
        "OpenStreetMap": baseOSM,
        "Esri World Imagery (Satélite)": baseESRI,
        "Esri Topográfico": baseTopo
      },
      {
        "Ráster MaxEnt": rasterLayer,
        "Vías": viasLayer,
        "Puntos PR": prLayer
      },
      { collapsed: false }
    ).addTo(map);

    L.control.scale({ imperial: false }).addTo(map);

    // Crear la leyenda
    const legendDiv = document.getElementById('legend');
    legendDiv.innerHTML = '<b>Clases de probabilidad (0–1)</b><br>';
    const etiquetas = ["0.0 \u2013 0.1", "0.1 \u2013 0.2", "0.2 \u2013 0.3", "0.3 \u2013 0.4", "0.4 \u2013 0.5", "0.5 \u2013 0.6", "0.6 \u2013 0.7", "0.7 \u2013 0.8", "0.8 \u2013 0.9", "0.9 \u2013 1.0"];
    for (let i = 0; i < colors.length; i++) {
      legendDiv.innerHTML += `<div><span style="background:${colors[i]}"></span>${etiquetas[i]}</div>`;
    }
  });
</script>
</body>
</html>
